import React from "react";
import notes from "../notes"

function template(props){
  return (<div className="note">
<h1>{props.title}</h1>
<p>{props.content}</p>
</div>)
}

function render(notes){
return (<template 
  Key = {notes.id}
  title = {notes.title}
  content = {notes.titcontentle}
/>)
}

function Note() {
  return (
    notes.map( render)
  );
}

export default Note;
